import React from "react";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from "./pages/Home/Home";
function App() {
  return <div>
    <Router>
    <Switch>
       <Route path="/" element={<Home />} />
    </Switch>
</Router>
  </div>;
}

export default App;
